import { FormLegend } from 'components';
import { withKnobs, text } from '@storybook/addon-knobs';

export default {
  title: 'FormLegend',
  component: FormLegend,
  decorators: [withKnobs],
};

export const Default = () => {
  return <FormLegend text={text('Legend Text', 'Market')} />;
};
